import React from 'react'
import { Button } from 'react-bootstrap'
import "./upload.css"
const Upload = () => {
  return (
    <div className='loginContainer'>
      <input type="file"/>
      <Button className='Load-more' >Upload</Button>
    </div>
  )
}

export default Upload
